const Keyboard = () => {
  const buttons = [0, 1, "AC", "="];

  return (
    <>
      <div class="flex  flex-wrap p-2 gap-3 justify-center">
        {buttons.map((r) => {
          return (
            <div className="srounded-xl w-[45%] h-[100px] text-center shadow-xl bg-white">
              <button className="h-[100%] w-[100%] text-3x ">{r}</button>
            </div>
          );
        })}
      </div>
    </>
  );
};

export default Keyboard;
